"""# Metriche da utilizzare

Come metriche utilizziamo

>IoU: E'anche famosa come Jaccard Index,la usiamo per valutare l'accuratezza della sovrapposizione tra maschere predette e maschere di groud-truth


> mIoU: La media dei valori della Iou,calcolata su tutte le classida predirre

![Screenshot from 2023-07-07 12-30-21.png](data:image/png;base64,)
"""

def my_accuracy(true_labels, predic_labels):
  num_correct = 0
  total_predic = len(true_labels)

  for true_label, predic_label in zip(true_labels, predic_labels):
      if true_label == predic_label:
          num_correct += 1

  accuracy = num_correct / total_predic
  return accuracy


##################

def compute_intersection_union(pred, label, num_class):
    """
    Function for calculating intersection and union for each class

    Args:
        pred: torch tensor of shape (H, W), predicted mask
        label: torch tensor of shape (H, W), ground truth mask
        num_class: int, number of classes

    Returns:
        area_inter: numpy array of shape (num_class,), intersection for each class
        area_union: numpy array of shape (num_class,), union for each class"""

    pred = np.asarray(pred) + 1
    label = np.asarray(label) + 1
    pred = pred * (label > 0)  # mask out ignored class (-1)

    intersection = pred * (pred == label)
    area_inter, _ = np.histogram(intersection, bins=num_class, range=(1, num_class))
    area_pred, _ = np.histogram(pred, bins=num_class, range=(1, num_class))
    area_label, _ = np.histogram(label, bins=num_class, range=(1, num_class))
    area_union = area_pred + area_label - area_inter

    return area_inter, area_union


def compute_iou(intersection, union):
    """
    Calcola intersection over union per ogni classe

    Args:
        intersection: numpy array of shape (num_class,), intersection for each class
        union: numpy array of shape (num_class,), union for each class

    Returns:
        iou: numpy array of shape (num_class,), intersection over union for each class
    """

    iou = 1.0 * intersection / (np.spacing(1) + union)
    return iou

