"""# UNET
![u-net-architecture.png](data:image/png;base64,)
Implementiamo adesso la rete neurale  UNet che è una rete fully-convolutional

Fu introdotta da Olaf Ronneberger, Philipp Fischer e Thomas Brox nel 2015.
Presenta una struttura **encoder-decoder**,
che permette di catturare sia le caratteristiche a basso livello che quelle a alto livello dell'immagine durante la segmentazione.

L'**encoder** si compone di una serie di blocchi di convoluzione, ciascuno dei quali include una convoluzione, una funzione di attivazione (di solito ReLU) e un'operazione di downsampling, tipicamente attraverso il max pooling. L'encoder riduce progressivamente la dimensione spaziale delle caratteristiche mentre aumenta il numero di canali.

Il **bridge** è uno strato intermedio che collega l'encoder al decoder. È composto da una serie di blocchi di convoluzione che permettono di catturare informazioni a diverse scale spaziali.


Il **decoder** è responsabile della ricostruzione dell'immagine segmentata a partire dalle caratteristiche estratte dall'encoder e dal bridge. Ogni blocco del decoder è composto da un'operazione di upsampling (tipicamente convoluzione trasposta) per aumentare la dimensione spaziale delle caratteristiche, seguita da una convoluzione, una funzione di attivazione e un'operazione di concatenazione con le caratteristiche corrispondenti dell'encoder.
Durante l'operazione di concatenazione nel decoder, vengono mescolate informazioni a diverse scale spaziali, consentendo al modello di combinare caratteristiche dettagliate dall'encoder con informazioni contestuali dal decoder.
"""

##############################################
#                                            #
#                 UNET                       #
#                                            #
##############################################

class DoubleConv(nn.Module):

  def __init__(self, in_channels,out_channels):
    super(DoubleConv,self).__init__()
    self.conv = nn.Sequential(
            nn.Conv2d(in_channels, out_channels,3,1,1, bias=False),
            nn.BatchNorm2d(out_channels),
            nn.ReLU(inplace=True),
            nn.Conv2d(out_channels, out_channels, 3, 1,1, bias=False),
            nn.BatchNorm2d(out_channels),
            nn.ReLU(inplace=True),
        )
  def forward(self,x):
      return self.conv(x)



class UNet(nn.Module):
    def __init__(self, in_channels,out_channels=5, features=[64,128,256,512]):
      super(UNet,self).__init__()
      self.ups=nn.ModuleList()
      self.down=nn.ModuleList()
      self.pool=nn.MaxPool2d(kernel_size=2,stride=2)
      #161x161, output: 160x160

      ##Down part
      for feature in features:
        self.down.append(DoubleConv(in_channels,feature))
        in_channels=feature

      ## Up Part
      for feature in reversed(features):
        self.ups.append(nn.ConvTranspose2d(feature*2,feature,kernel_size=2,stride=2))
        self.ups.append(DoubleConv(feature*2,feature))

      self.bottleneck= DoubleConv(features[-1],features[-1]*2)
      self.final_conv=nn.Conv2d(features[0],out_channels,kernel_size=1)

    def forward(self,x):
        skip_connections=[]

        for down in self.down:
            x=down(x)
            skip_connections.append(x)
            x=self.pool(x)

        x=self.bottleneck(x)
        skip_connections=skip_connections[::-1]

        for idx in range(0,len(self.ups),2):
            x=self.ups[idx](x)
            skip_connection=skip_connections[idx//2]

            if(x.shape!= skip_connection.shape):
                x=transforms.resize(x,size=skip_connection.shape[2:])

            concat_skip=torch.cat((skip_connection,x),dim=1)
            x=self.ups[idx+1](concat_skip)


        return self.final_conv(x)

"""**Convoluzione** --> La convoluzione è l'operazione principale nella maggior parte delle reti neurali convoluzionali, inclusa U-Net. Consiste nell'applicare uno o più filtri (o kernel) a un'immagine o a un volume di dati. Ogni filtro scorrerà sull'input e calcolerà una somma pesata delle regioni corrispondenti. In U-Net, le convoluzioni permettono di rilevare, estraendo progressivamente, caratteristiche dai dati in input. Ciò aiuta la rete a imparare a riconoscere modelli, forme e strutture rilevanti per il problema di segmentazione delle immagini.

**ReLU** (Rectified Linear Activation) --> La funzione di attivazione ReLU è utilizzata per introdurre la non linearità nella rete. Dopo ogni operazione di convoluzione, ReLU applica la funzione ReLU element-wise ai dati, impostando a zero tutti i valori negativi e lasciando invariati i valori positivi. Questo aiuta a introdurre la capacità di apprendere relazioni non lineari tra i dati di input e le caratteristiche estratte. La funzione ReLU è definita come f(x) = max(0, x).

**Max Pooling** --> Il max pooling è una tecnica di sottocampionamento che riduce le dimensioni spaziali dei dati campionando solo il valore massimo in regioni disgiunte. In U-Net, il max pooling viene utilizzato per ridurre progressivamente le dimensioni dell'immagine in input, mantenendo solo le informazioni più rilevanti. Questa operazione aiuta a ridurre la quantità di calcolo necessaria e il rischio di overfitting, oltre a favorire la creazione di una rappresentazione delle caratteristiche più focalizzata.
"""

