##===== Funzione per fare il training

def train(model, optimizer, loss_function, train_loader, num_epochs, curr_epoch,
          train_loss_list, epoch_list,acc_train_list, iou_mean_train_list, iou_c0_train, iou_c1_train,
          iou_c2_train, iou_c3_train, iou_c4_train, device=device ):

    #contatore loss totale
    training_loss = 0.0

    model.train()
    predic_labels = []
    true_labels = []
    out_list=[]
    batch_idx=0

    loop = tqdm(train_loader,desc=f"Training Set->epoch {curr_epoch+1}/{num_epochs}")
    for batch in loop:


       inputs, targets = batch
       inputs = inputs.to(device)
       targets=targets.to(device)
       output = model(inputs)
       #print("\nOutput\n",output,"\n")



       ############ #Visualizzo come esempio la prima immagine della batch

       print("\n Prima immagine batch:\n")
       prova= targets[0]
       prova= prova.cpu().numpy()
       fig, axes = plt.subplots(1, 2, figsize=(5, 2))
       out_list=[]
       out_list.extend(output.cpu())
       output_pred=out_list[0].cpu().argmax(dim=0).numpy()

       axes[0].imshow(prova, cmap=custom_cmap)
       axes[0].set_title("True label")

       axes[1].imshow(output_pred,cmap=custom_cmap)
       axes[1].set_title("Predicted label")

       plt.show()
       plt.axis('off')  # Nascondere gli assi
       plt.close()
      ###########################################################################

       '''
       Output shape torch.Size([3, 5, 512, 512])
        TARGET sQUEEZ è torch.Size([3, 512, 512])
      '''

       loss = loss_function(output, targets.squeeze(1))

        ## devo azzerare i gradienti a ogni iterazione sulla batch
       optimizer.zero_grad()

       ##backpropagation
       loss.backward()

       optimizer.step()

       ##aggiorno contatore training_loss
       ##devo moltiplicare la loss per quante immagini ci sono perché il valore dentro loss è la media
       ##delle loss delle 4 immagini
       training_loss += loss.item() * inputs.size(0)
       print("\n Epoca",curr_epoch+1,"/",num_epochs,"e batch",batch_idx,"/",
             len(train_loader),". La Loss per questa batch è", loss.item(),"\n")


       '''
       '''
       #conversione delle probabilità di output in labels predette
       _ , predicted = torch.max(output, dim=1)
       predic_labels.extend(predicted.cpu())
       true_labels.extend(targets.cpu())
       out_list.extend(output.cpu())

       batch_idx+=1


    #Conversione dei diversi tensori pytorch nelle variabili "predic" e "true" in tensori numpy
    for i in range (len(targets)):
        true_labels[i] = true_labels[i].numpy()
    for i in range (len(predic_labels)):
        predic_labels[i] = predic_labels[i].numpy()

    #Conversione in array numpy e rimozione di dimensioni superflue
    predic_labels = np.array(predic_labels)
    predic_labels = np.squeeze(predic_labels)
    true_labels = np.array(true_labels)
    true_labels = np.squeeze(true_labels)

    #Conversione affinchè la rappresentazione sia tramite array monodimensionale
    predic_labels = np.array(predic_labels).flatten()
    true_labels = np.array(true_labels).flatten()

    #Stampa dei risultati di Accuracy e IoU sulle predizioni ottenute
    acc = my_accuracy(true_labels, predic_labels)
    print("Valore di Accuracy:", acc)
    acc_train_list.append(acc)
    print("Ora calcolo la IOU")

    (intersec,union)= compute_intersection_union(true_labels,predic_labels,5)
    iou_val= compute_iou(intersec,union)

    iou_mean=0
    for i in range(len(iou_val)):
        iou_mean+=iou_val[i]
    iou_mean/=num_classes
    print("IoU per ogni classe:", iou_val)
    print("IoU media:", iou_mean)
    print("\n")
    iou_c0_train.append(iou_val[0])
    iou_c1_train.append(iou_val[1])
    iou_c2_train.append(iou_val[2])
    iou_c3_train.append(iou_val[3])
    iou_c4_train.append(iou_val[4])
      #iou_c5.append(iou_val[5])
    iou_mean_train_list.append(iou_mean)


    #dopo fine for
    training_loss /= len(training_set)


    print('Training Loss: {:.4f}'.format(training_loss))


    train_loss_list.append(training_loss)
