#funzione per addestramento su test set
def test(model, loss_function, test_loader, device=device):
    model.eval()
    test_loss = 0.0
    predic_labels = []
    true_labels = []
    test_loader = tqdm(test_loader, desc=f"Eseguendo il modello sul test set...")
    #si disabilita il calcolo del gradiente e non si effettua backpropagation in quanto non è necessario aggiornare i pesi (motivo per cui non è necessario nemmeno l'ottimizzatore)
    with torch.no_grad():
      for batch in test_loader:
        inputs, targets = batch

        inputs = inputs.to(device)
        targets = targets.to(device)

        output = model(inputs)
        loss = loss_function(output, targets.squeeze(1))
        test_loss += loss.item() * inputs.size(0)

        #conversione delle probabilità di output in labels predette
        _ , predicted = torch.max(output, dim=1)
        predic_labels.extend(predicted.cpu())
        true_labels.extend(targets.cpu())

    test_loss /= len(test_set)
    print('\n\nTest Loss: {:.4f}'.format(test_loss))

    return test_loss, predic_labels, true_labels

